import React, { Component } from 'react';
import {
    BrowserRouter as Router,
    Routes,
    Route
} from 'react-router-dom'

import Login from '../pages/Login';
import Home from '../pages/Home';
import Trips from '../pages/Trips';
import About from '../pages/About';
import ProtectedRoute from '../auth/ProtectedRoute';

class Main extends Component {

    constructor(props) {
        super(props);
    }

    render() {
        return (
            <Router>
                <Routes>
                    <Route path="login" element={<Login />}></Route>
                    <Route path="/" element={<ProtectedRoute><Home /></ProtectedRoute>}></Route>
                    <Route path="/trips" element={<ProtectedRoute><Trips /></ProtectedRoute>}></Route>
                    <Route path="/about" element={<ProtectedRoute><About /></ProtectedRoute>}></Route>
                    <Route path="/about" element={<ProtectedRoute><Profile /></ProtectedRoute>}></Route>
                </Routes>
            </Router>
        );
    }
}

export default Main;
